	('1a8c7c68-0fe6-4f80-a1f7-db71a9470731', 'USER', '[]', 'emily.lee999@gmail.com', b'0', '황지민', 'emily999', 'emily9998', '010-2468-1357', '황지민입니다. 디자인과 기술의 융합에 관심이 있으며, 창의적인 문제 해결을 추구합니다.', 'NORMAL', '["2024-01022", "2024-13946", "2024-14936"]', 'NULL', '2024-09-30 16:20:00.000000', 'http://localhost:8080/upload/5123e3f8-12c3-42d3-9fad-5cbc808e0793.jpg', '2024-12-03 13:35:00.000000'),
