	('008259a9-9df6-4e2b-a3b2-6ebe348354a4', '관리자', '안녕하세요, 고객님. 해외 배송은 가능하나, 일부 국가에 대해서는 제한이 있을 수 있습니다. 배송비와 세금이 추가될 수 있으니, 고객센터로 문의 후 배송 국가를 확인해주세요.', '[]', '해외로도 배송이 가능한가요? 어떤 조건이 필요한지 알려주세요.', '2024-11-06 20:30:00.000000', 21, 132465, '[]', 'ANSCOMPLETE', '해외 배송 가능 여부', 0, '7da7183d-1726-458a-a620-93590251ca85'),
	('082c4f8d-0b50-428d-a46d-8ed454cef65f', '관리자', '안녕하세요, 고객님. 상품 페이지 하단에 \'리뷰 작성\' 버튼을 클릭하시면 리뷰를 남기실 수 있습니다. 리뷰 작성 시, 상품에 대한 평가와 함께 사진도 첨부 가능합니다.', '[]', '상품을 구매했는데, 리뷰를 작성하려고 하는데 어떻게 해야 하나요?', '2024-11-06 17:50:00.000000', 18, 246810, '[]', 'ANSCOMPLETE', '상품 리뷰 작성 방법', 0, '4b319be7-a20d-464f-9ad0-6bc5d401d48c'),
	('0aa4a8e6-17cb-4f8b-8a1e-44b2a2fbf1a8', '관리자', '안녕하세요, 고객님. 제품의 사용 설명서는 제품 페이지에서 다운로드 가능합니다. 또한, 이메일로도 전송해드릴 수 있습니다. 고객님의 이메일 주소를 알려주세요.', '[]', '제품 사용 설명서를 이메일로 받을 수 있을까요?', '2024-11-06 21:15:00.000000', 22, 852963, '[]', 'ANSCOMPLETE', '제품 사용 설명서 요청', 0, 'de7c3a39-186b-476b-9763-cc1ef2c3fadc'),
	('1db2e21b-8ff6-4339-ac22-afa6bd9631e9', '관리자', '안녕하세요, 고객님. 환불 처리는 보통 3~5일 내에 완료됩니다. 결제 방식에 따라 환불 시간이 다를 수 있으니, 참고 부탁드립니다.', '[]', '환불 요청을 했는데, 처리가 언제 될까요?', '2024-11-07 08:30:00.000000', 26, 123789, '[]', 'ANSCOMPLETE', '환불 요청 처리 시간', 0, '368de3a0-e332-4cbd-ac9f-eb8f39c7a97e'),
	('1f2cf8d8-b2bf-450a-94e9-aa34cc7248a5', '관리자', '안녕하세요, 고객님. 주문이 취소된 경우, 환불은 결제 방식에 따라 진행됩니다. 카드 결제는 3~5일 내 환불되며, 계좌이체는 5~7일 소요됩니다.', '[]', '주문이 취소되었는데, 환불은 어떻게 진행되나요?', '2024-11-06 22:05:00.000000', 23, 369258, '[]', 'ANSCOMPLETE', '취소된 주문에 대한 환불 절차', 0, '4b319be7-a20d-464f-9ad0-6bc5d401d48c'),
	('1ff02660-e3fd-49e8-8a8e-3ae5bd4af616', '관리자', '안녕하세요, 고객님. 배송 주소 변경은 상품이 출고되기 전까지 가능합니다. 고객센터로 연락을 주시면 주소 변경 절차를 도와드리겠습니다.', '[]', '주문한 상품의 배송 주소를 변경하고 싶습니다. 어떻게 해야 하나요?', '2024-11-06 15:30:00.000000', 16, 135792, '[]', 'ANSCOMPLETE', '배송 주소 변경 요청', 0, '85b95a95-fe4f-4465-98c7-d7ed00653668'),
	('21703323-9b4b-485b-a410-45269145de95', '관리자', '안녕하세요, 고객님. 쿠폰이 적용되지 않는 경우는 쿠폰 코드가 만료되었거나, 적용 가능한 상품군에 제한이 있을 수 있습니다. 자세한 사항은 고객센터로 문의 주시면 도와드리겠습니다.', '[]', '쿠폰을 사용하려고 했는데, 오류가 발생해서 적용되지 않습니다. 해결 방법을 알려주세요.', '2024-11-06 13:45:00.000000', 14, 112358, '[]', 'ANSCOMPLETE', '쿠폰 사용 시 오류 발생', 0, '0e3c7182-48fa-4d66-9f81-b5570b75424b'),
	('8c2a494f-cb36-4fb6-9ad9-5343803118e9', '관리자', '안녕하세요, 고객님. 환불을 원하시는 상품의 반품 절차를 안내드리겠습니다. 상품 반품 후 환불 처리해드리겠습니다.', '[]', '상품이 마음에 들지 않아서 환불을 요청하고 싶습니다. 환불 절차를 안내해 주세요.', '2024-11-05 16:10:00.000000', 3, 789012, '[]', 'ANSCOMPLETE', '환불 절차에 대해 문의드립니다.', 0, '368de3a0-e332-4cbd-ac9f-eb8f39c7a97e'),
	('900c0f45-0897-4185-bca3-c379108be914', '관리자', '안녕하세요, 고객님. 회원 탈퇴는 계정 관리 페이지에서 직접 진행할 수 있습니다. 탈퇴 버튼을 클릭하면 관련 절차가 안내됩니다.', '[]', '회원 탈퇴를 하고 싶습니다. 탈퇴 절차를 알려주세요.', '2024-11-05 22:30:00.000000', 10, 918273, '[]', 'ANSCOMPLETE', '회원 탈퇴 방법 문의', 0, '348d99fe-8c08-436a-8597-31c64598a2f0'),
	('90e34c2b-7679-4f98-ae6f-687b4705fff9', '관리자', '안녕하세요, 고객님. 카드 결제 오류는 여러 원인에 의해 발생할 수 있습니다. 카드 정보 입력 오류, 결제 한도 초과 등을 확인해 주세요. 만약 문제가 계속된다면, 고객센터로 문의해 주세요.', '[]', '카드 결제 중 오류가 발생했어요. 해결 방법을 알려주세요.', '2024-11-06 23:45:00.000000', 25, 654321, '[]', 'ANSCOMPLETE', '카드 결제 오류 해결 방법', 0, '8fcc64bc-6018-4f24-9dce-ae7160bf106b'),
	('9c5167a9-139d-4812-be78-5d488598bbfb', '관리자', '안녕하세요, 고객님. 해당 제품은 간단한 사용법이 포함된 매뉴얼을 제공하고 있습니다. 첨부된 파일을 참고하시거나, 추가적인 설명이 필요하시면 다시 문의 주세요.', '[]', '구매한 제품의 사용법이 잘 이해되지 않습니다. 사용법을 자세히 알려주세요.', '2024-11-05 20:10:00.000000', 8, 567890, '[]', 'ANSCOMPLETE', '제품 사용법 문의', 0, '06a99a75-7bed-4943-9b7b-9ef9a1377bf3'),
	('a5bc6c72-ea51-45f5-9348-d6b4df98fba0', '관리자', '안녕하세요, 고객님. 쿠폰은 결제 시 쿠폰 코드를 입력하시면 할인이 적용됩니다. 쿠폰 코드 입력란을 확인해 주세요.', '[]', '쿠폰을 받았는데 어떻게 사용해야 하는지 잘 모르겠습니다. 사용 방법을 안내해주세요.', '2024-11-05 18:00:00.000000', 5, 987654, '[]', 'ANSCOMPLETE', '쿠폰 사용 방법에 대해 문의드립니다.', 0, '506bedb9-fa45-4700-8372-bee147a12ec2'),
	('a8aebc7a-e47a-4aa3-82ec-25cd7874e2ba', '관리자', '안녕하세요, 고객님. 주문하신 상품은 내일 출고 예정입니다. 자세한 배송 일정은 주문 확인 페이지에서 확인 가능합니다.', '[]', '상품을 주문했는데 배송이 언제 시작되는지 궁금합니다. 배송 일정에 대해 알려주세요.', '2024-11-05 15:00:00.000000', 2, 654321, '[]', 'ANSCOMPLETE', '배송이 언제 시작되나요?', 0, '8fcc64bc-6018-4f24-9dce-ae7160bf106b'),
	('aa9a822c-dfaf-4f89-9e2c-8b4c7aff45d9', '관리자', '안녕하세요, 고객님. 할인 코드는 결제 시 코드 입력란에 입력하시면 적용됩니다. 일부 할인 코드는 특정 상품에만 사용 가능하므로, 해당 코드가 유효한지 확인해 주세요.', '[]', '할인 코드를 얻었는데, 어떻게 사용해야 할지 모르겠습니다. 사용 방법을 알려주세요.', '2024-11-06 11:25:00.000000', 12, 753159, '[]', 'ANSCOMPLETE', '할인 코드 사용 방법 문의', 0, '4b319be7-a20d-464f-9ad0-6bc5d401d48c'),
	('b1e08383-04c0-428f-8dca-dd71a3ed6c20', NULL, NULL, '[]', '이 제품은 품절인가요? 재입고 예정이 있나요?', '2024-11-07 10:20:00.000000', 28, 964258, '[]', 'ANSWAIT', '제품 품절 여부 확인', 0, '9d6fa4b8-7a0a-4abc-bfe4-6a2929a896e0'),
	('b9b96254-d900-436f-a4b4-d9476dd09b00', '관리자', '안녕하세요, 고객님. 결제 취소는 결제 완료 후 24시간 이내에 가능합니다. 취소를 원하시면 고객센터로 연락 주시기 바랍니다.', '[]', '결제 후 취소를 요청하고 싶습니다. 취소 절차를 알려주세요.', '2024-11-06 14:55:00.000000', 15, 654321, '[]', 'ANSCOMPLETE', '결제 취소 요청', 0, '8e968eff-bb85-4cf0-a2c1-cb11bd0733fd'),
	('bb0d9135-9f89-47b6-bb7a-65edf8f3f1f8', NULL, NULL, '[]', '배송 중인 상품을 추적하려면 어떻게 해야 하나요?', '2024-11-07 12:15:00.000000', 30, 741852, '[]', 'ANSWAIT', '배송 추적 방법', 0, '953f9bef-b0bb-4f7d-8536-ca8c8aa04152'),
	('be281f03-459f-471c-9d39-3cd0b2b86f64', '관리자', '안녕하세요, 고객님. 적립금은 결제 페이지에서 사용 가능합니다. 결제 시 \'적립금 사용\' 버튼을 클릭한 후, 사용하실 적립금을 입력해 주세요.', '[]', '적립금을 사용하고 싶습니다. 어떻게 사용하나요?', '2024-11-06 16:40:00.000000', 17, 987654, '[]', 'ANSCOMPLETE', '적립금 사용 방법', 0, '9790d693-9538-4950-b6d9-e01befcbadac'),
	('c50580b0-c50a-4961-8703-88bf0767765b', '관리자', '안녕하세요, 고객님. 회원 탈퇴는 고객센터를 통해 요청하셔야 합니다. 요청 후, 계정이 삭제되는 과정은 3~5일 소요될 수 있습니다.', '[]', '회원 탈퇴를 하려고 하는데, 절차를 알려 주세요.', '2024-11-06 18:20:00.000000', 19, 112233, '[]', 'ANSCOMPLETE', '회원 탈퇴 방법', 0, '06a99a75-7bed-4943-9b7b-9ef9a1377bf3'),
	('c97cff74-203d-44ac-8026-f9a4b107887d', '관리자', '안녕하세요, 고객님. 정기 배송 서비스는 상품 페이지에서 \'정기 배송 신청\' 옵션을 선택하여 가입하실 수 있습니다. 배송 주기와 제품을 선택한 후, 결제를 완료해 주세요.', '[]', '정기 배송 서비스를 사용하려면 어떻게 해야 하나요?', '2024-11-06 23:00:00.000000', 24, 741258, '[]', 'ANSCOMPLETE', '정기 배송 서비스 사용 방법', 0, '506bedb9-fa45-4700-8372-bee147a12ec2'),
	('ddeb04fa-2454-4f62-9800-0fbe81e18fd3', NULL, NULL, '[]', '적립 포인트는 어떻게 사용하나요? 결제 시 적용 가능한가요?', '2024-11-07 11:00:00.000000', 29, 356741, '[]', 'ANSWAIT', '적립 포인트 사용 방법', 0, 'd9870e59-0285-4aef-9fb8-f0b84bc422b4'),
	('de75710c-e8d6-44ff-8619-e8fddede31ef', '관리자', '안녕하세요, 고객님. 상품 주문 취소는 고객센터를 통해 가능합니다. 고객님의 주문 번호를 알려주시면 빠르게 처리해드리겠습니다. 감사합니다.', '[]', '안녕하세요, 상품을 잘못 주문해서 취소하고 싶은데 방법을 알 수 있을까요? 주문 취소 절차에 대해 안내 부탁드립니다.', '2024-11-05 14:30:00.000000', 1, 123456, '[]', 'ANSCOMPLETE', '상품 주문 취소 방법에 대해 문의드립니다.', 0, '08ff8005-3bae-453c-b2f9-d6fa24b57901'),
	('e7cf3fe7-ee8f-43f0-836d-2d8cc76cad30', '관리자', '안녕하세요, 고객님. 주문 취소는 상품이 출고되기 전까지 가능합니다. 출고 후에는 취소가 불가능하므로, 빠르게 고객센터로 연락 주시기 바랍니다.', '[]', '주문 후 취소가 가능한지 궁금합니다. 취소 정책을 알려 주세요.', '2024-11-06 19:10:00.000000', 20, 543210, '[]', 'ANSCOMPLETE', '주문 취소 정책', 0, '9d6fa4b8-7a0a-4abc-bfe4-6a2929a896e0'),
	('ec16bd2e-3224-4767-b9af-7835c3cb2f68', '관리자', '안녕하세요, 고객님. 적립금은 결제 시 \'적립금 사용\' 항목에서 사용할 수 있습니다. 결제 페이지에서 확인해 주세요.', '[]', '적립금을 어떻게 사용할 수 있는지 궁금합니다. 결제 시 적립금을 사용할 수 있는지 알려주세요.', '2024-11-05 18:30:00.000000', 6, 135792, '[]', 'ANSCOMPLETE', '적립금 사용 방법을 알고 싶습니다.', 0, '9d6fa4b8-7a0a-4abc-bfe4-6a2929a896e0'),
	('ecf31348-9563-4d11-ab9e-41d989082417', '관리자', '안녕하세요, 고객님. 제품 교환은 구매 후 7일 이내에 가능하며, 교환을 원하시면 고객센터에 문의 주시고, 제품 상태를 확인한 후 진행됩니다.', '[]', '구매한 제품을 교환하고 싶은데, 절차가 어떻게 되나요?', '2024-11-07 09:10:00.000000', 27, 547852, '[]', 'ANSCOMPLETE', '제품 교환 절차', 0, '06a99a75-7bed-4943-9b7b-9ef9a1377bf3'),
	('ed10cd13-48e4-402b-930e-ddfce7ca1114', '관리자', '안녕하세요, 고객님. 반품은 상품 수령 후 14일 이내에 가능합니다. 반품 신청서를 작성한 후, 상품을 원래 포장 상태로 보내주세요. 자세한 내용은 첨부된 반품 절차를 참고해 주세요.', '[]', '구매한 상품이 맘에 들지 않아 반품을 원합니다. 반품 절차를 설명해 주세요.', '2024-11-06 12:35:00.000000', 13, 202305, '[]', 'ANSCOMPLETE', '반품 절차에 대한 문의', 0, '506bedb9-fa45-4700-8372-bee147a12ec2'),
	('eff2e514-ed04-426b-baa0-6d03ab8f99f0', '관리자', '안녕하세요, 고객님. 배송지 변경은 상품이 출발하기 전에만 가능합니다. 변경을 원하시면 고객센터로 연락 주시면 바로 처리해드리겠습니다.', '[]', '상품 배송 전에 배송지를 변경하고 싶습니다. 어떻게 처리해야 하나요?', '2024-11-05 21:20:00.000000', 9, 102938, '[]', 'ANSCOMPLETE', '배송지 변경 요청', 0, '9790d693-9538-4950-b6d9-e01befcbadac'),
	('f1c11198-2e15-47a2-8c3c-446dff7267b3', '관리자', '안녕하세요, 고객님. 세금 계산서는 고객님의 주문 내역을 바탕으로 발급이 가능합니다. 발급 절차는 고객센터를 통해 진행됩니다. 자세한 사항은 고객센터로 문의 부탁드립니다.', '[]', '세금 계산서를 발급받고 싶은데 어떻게 해야 하나요? 발급 절차를 안내해 주세요.', '2024-11-05 19:00:00.000000', 7, 246801, '[]', 'ANSCOMPLETE', '세금 계산서 발급 관련 문의', 0, 'f78f04bf-eccd-4f7a-8389-6b241a7a6aae'),
	('faa44153-c42c-4d6e-acfd-d6c58c45a0b7', '관리자', '안녕하세요, 고객님. 로그인 오류는 비밀번호가 잘못 입력되었을 가능성이 있습니다. 비밀번호 재설정을 시도해 보시기 바랍니다.', '[]', '회원가입 후 로그인 시 오류가 발생합니다. 아이디와 비밀번호를 입력했는데 계속 로그인되지 않습니다. 해결 방법을 알려주세요.', '2024-11-05 17:30:00.000000', 4, 345678, '[]', 'ANSCOMPLETE', '회원가입 후 로그인 오류 발생', 0, '99571590-bf45-4ad0-ac32-de1c7cb1b1ff'),
	('fec9f183-9601-41e0-8628-886a8402aa02', '관리자', '안녕하세요, 고객님. 교환은 상품을 수령한 날로부터 7일 이내에 가능합니다. 상품 상태가 원래와 동일해야 하며, 교환을 원하시는 상품과 동일한 카테고리에서 진행됩니다.', '[]', '구매한 상품이 마음에 들지 않아서 교환을 하고 싶은데, 교환 절차가 어떻게 되나요?', '2024-11-06 10:15:00.000000', 11, 314159, '[]', 'ANSCOMPLETE', '교환 정책에 관한 질문', 0, '8fb98fb6-6b3c-4a00-92f8-68a0f53bf0ae');
